import React from 'react';
import Header from '..shared/Header';
import Footer from '..shared/Footer';
import Results from './Results';

function ResultsLayout(props) {
    return (
        <div>
            <Header />
            <main className="main-content">
                <div className="wrap">
                    <Results {...props} />} />
                </div>
            </main>
            <Footer />
        </div>
    );
}

export default ResultsLayout;
